import React, { useState } from "react";
import { one, two, three } from "./req.js";
const New = () => {
  const [materials, setMaterials] = useState("");
  const [color, setColor] = useState("");
  const [size, setSize] = useState("");

  return (
    <div>
      <select
        onChange={(e) => {
          const selectedMat = e.target.value;
          setMaterials(selectedMat);
        }}
      >
        {one.map((mat) => (
          <option value={mat.value}>{mat.label}</option>
        ))}
      </select>
      <select
        onChange={(e) => {
          const selectedCol = e.target.value;
          setMaterials(selectedCol);
        }}
      >
        {two.map((mat) => (
          <option value={mat.value}>{mat.label}</option>
        ))}
      </select>
      <select
        onChange={(e) => {
          const selectedSize = e.target.value;
          setMaterials(selectedSize);
        }}
      >
        {three.map((mat) => (
          <option value={mat.value}>{mat.label}</option>
        ))}
      </select>
      <h5>{materials.label}</h5>
      <h5>{color.label}</h5>
      <h5>{size.label}</h5>
      {materials}
    </div>
  );
};
export default New;
